import React from "react";
import {Box} from "@mui/material";

const HorizontalScrollbar =({data1})=>{
    return(
        <div>
            {data1.map((item)=>(
                <Box
                key={item.id||item}
                itemId={item.id||item}
                title={item.id||item}>
                    {item}
                </Box>
            ))}
        </div>
    )
}

export default HorizontalScrollbar;
